/** @jsxImportSource theme-ui */
import "./App.css";
import { ThemeProvider } from "theme-ui";
import { theme } from "./theme";
import ButtonComponent from "./atoms/Button/ButtonComponent";

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <ButtonComponent
        styles={{backgroundColor: 'buttonBackground', color: 'buttonText', border: 'border', fontSize: 'btnText' }}
        handleClick={(event) => {
            console.log("Clicked me");
          }}
        >
          Click me
        </ButtonComponent>
      </div>
    </ThemeProvider>
  );
}

export default App;
